import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import React, {useState} from 'react';
import LogReg from './views/LogReg';
import MainPage from './components/MainPage';
import ViewProfile from './components/ViewProfile';
import InfoPage from './components/InfoPage';
import Messenger from './components/messenger/Messenger';

function App() {

  const [userId, setUserId] = useState("");

  return (
    <div className="App">
      <h1>Hello World</h1>
      <BrowserRouter>
        <Routes>
          <Route element={<LogReg />} path="/" userId = {userId} setUserId = {setUserId} />
          <Route element={<MainPage />} path="/home" userId = {userId} />
          <Route element={<ViewProfile />} path="/profile/:id" userId = {userId} />
          <Route element={<InfoPage/>} path="/app/info" />
          <Route element={<Messenger/>} path="/barchat"/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
